import {BaseEntity, Column, Entity, JoinColumn, ManyToOne, PrimaryGeneratedColumn, RelationId} from "typeorm";
import {UserEntity} from "./user";
import {FamilyLogType, FileLogType} from "../../../../shared/log";
import {FamilyEntity} from "./family";

@Entity()
export class LogEntity extends BaseEntity {

    @PrimaryGeneratedColumn()
    id: number;

    /**   */
    @Column({ type: "varchar", length: 1024})
    text: string;
    /**   */
    @Column({ type: "varchar", length: 100 })
    type:FileLogType;

    @Column({ type: "int", default: 0 })
    userId: number;

    /**    ,   */
    @Column({ type: "int", default: 0, nullable: true })
    target?: number;

    /**     UNIX TIMESTAMP */
    @Column({ type: "int", default: 0 })
    time: number;
}

@Entity()
export class LogFamilyEntity extends BaseEntity {

    @PrimaryGeneratedColumn()
    id: number;

    /**   */
    @Column({ type: "varchar", length: 1024})
    text: string;
    /**   */
    @Column({ type: "varchar", length: 100 })
    type:FamilyLogType;

    @Column({ type: "int", default: 0 })
    familyId: number;

    /**    ,   */
    @Column({ type: "int", default: 0, nullable: true })
    target?: number;


    /**    ,   */
    @Column({ type: "varchar", length: 50 })
    targetName?: string;

    /**     UNIX TIMESTAMP */
    @Column({ type: "int", default: 0 })
    time: number;


    /** ,   */
    @Column({ type: "int", default: 0 })
    count: number;
}

@Entity()
export class LogItemsEntity extends BaseEntity {

    @PrimaryGeneratedColumn()
    id: number;

    /**   */
    @Column({ type: "varchar", length: 1024})
    text: string;

    /** ID  */
    @Column({ type: "varchar", length: 1024})
    ids: string;

    /**  */
    @Column({ type: "varchar", length: 1024})
    who: string;

    /**     UNIX TIMESTAMP */
    @Column({ type: "int", default: 0 })
    time: number;
}
